(954, 'en', 'default', '0ef460f8863506f51ade1842e8450c85', 'At a Glance', NULL, NULL, 'LINE', NULL, 0, '', '14ab08e43e5fc0c3319c74f846811a89'),
(955, 'en', 'default', 'ecfc2dffe568c10a67dbc6d3724cfde2', 'Activity', NULL, NULL, 'LINE', NULL, 0, '', '7dd8213cbc097f61b4fcceb5ddbe4985'),
(956, 'en', 'default', 'ad23e5619296597ab99608c6918be8ca', 'Quick Draft', NULL, NULL, 'LINE', NULL, 0, '', 'cdea2069361117b9ed84f249ca3b61b9'),
(957, 'en', 'default', 'db3af42ba64b595db6ab3ea999fe0bb1', 'Drafts', NULL, NULL, 'LINE', NULL, 0, '', '430564c7cd269a745a1077be966cb4e4'),
(958, 'en', 'default', '228f221f2684b48861b59b409704abb5', 'WordPress News', NULL, NULL, 'LINE', NULL, 0, '', '6ec9b8b8fa4cf0325c38400d1abad845'),
(959, 'en', 'default', '7bb5b05b47216f59eeab4b23d0014277', 'Welcome to your WordPress Dashboard! This is the screen you will see when you log in to your site, and gives you access to all the site management features of WordPress. You can get help for any screen by clicking the Help tab above the screen title.', NULL, NULL, 'LINE', NULL, 0, '', 'caa3ada644015d7da497c61e78d64e63'),
(960, 'en', 'default', '030eb735ca4d9aed22505e6adb6e37c1', 'The left-hand navigation menu provides links to all of the WordPress administration screens, with submenu items displayed on hover. You can minimize this menu to a narrow icon strip by clicking on the Collapse Menu arrow at the bottom.', NULL, NULL, 'LINE', NULL, 0, '', 'a199554e617c102a6467d92c120ed216'),
(961, 'en', 'default', 'ca887a8513c595e757361973c401dfc3', 'Links in the Toolbar at the top of the screen connect your dashboard and the front end of your site, and provide access to your profile and helpful WordPress information.', NULL, NULL, 'LINE', NULL, 0, '', '9ae02a33eb223e22333569fc7a0b76e7'),
(962, 'en', 'default', '846495f9ceed11accf8879f555936a7d', 'Navigation', NULL, NULL, 'LINE', NULL, 0, '', '52b4c7dc9c72494863e18b45a3f4c4ce'),
(963, 'en', 'default', '5d3cfb1969cd32ce072f4a154329dbf9', 'You can use the following controls to arrange your Dashboard screen to suit your workflow. This is true on most other administration screens as well.', NULL, NULL, 'LINE', NULL, 0, '', '96659bd2478b2ec608973ec63c74de4c'),
(964, 'en', 'default', 'a98be58ec342822c43f9a60f423b1d2f', '<strong>Screen Options</strong> &mdash; Use the Screen Options tab to choose which Dashboard boxes to show.', NULL, NULL, 'LINE', NULL, 0, '', 'ed407f0af001c6226b4cc9be2875d701'),
(965, 'en', 'default', '71ce1121b4c5579d8f2c8e71335b9a22', '<strong>Drag and Drop</strong> &mdash; To rearrange the boxes, drag and drop by clicking on the title bar of the selected box and releasing when you see a gray dotted-line rectangle appear in the location you want to place the box.', NULL, NULL, 'LINE', NULL, 0, '', '5152a8dbc58f8c3531ec3b414be417aa'),
(966, 'en', 'default', 'b65fa8d75f92ea10c226c9c9e107cfc6', '<strong>Box Controls</strong> &mdash; Click the title bar of the box to expand or collapse it. Some boxes added by plugins may have configurable content, and will show a &#8220;Configure&#8221; link in the title bar if you hover over it.', NULL, NULL, 'LINE', NULL, 0, '', '54545fe38eda999a7a67927af2e0e559'),
