(2057, 'en', 'default', '60be57d14942b01e4d2bccff314615dc', 'Pages are similar to posts in that they have a title, body text, and associated metadata, but they are different in that they are not part of the chronological blog stream, kind of like permanent posts. Pages are not categorized or tagged, but can have a hierarchy. You can nest pages under other pages by making one the &#8220;Parent&#8221; of the other, creating a group of pages.', NULL, NULL, 'LINE', NULL, 0, '', '5bb48b4ca8537da5fe1c709d252a3dab'),
(2058, 'en', 'default', '87a4cd24ed88393b68b0c3eeaa9293ae', 'Managing Pages', NULL, NULL, 'LINE', NULL, 0, '', 'd37efe53d3cb0e5aec280a71039aaa15'),
(2059, 'en', 'default', '713db89d7ae9e244d012fb9dd9a53982', 'Managing pages is very similar to managing posts, and the screens can be customized in the same way.', NULL, NULL, 'LINE', NULL, 0, '', '5f160f3c0999b6f3c714064351523da7'),
(2060, 'en', 'default', '653290ee830033b040967d621084cb0f', 'You can also perform the same types of actions, including narrowing the list by using the filters, acting on a page using the action links that appear when you hover over a row, or using the Bulk Actions menu to edit the metadata for multiple pages at once.', NULL, NULL, 'LINE', NULL, 0, '', 'de3f01588a23e6930c757cb640155dfa'),
(2061, 'en', 'default', '4635b2f1e0085899e9e4935c274058b8', '<a href="https://codex.wordpress.org/Pages_Screen">Documentation on Managing Pages</a>', NULL, NULL, 'LINE', NULL, 0, '', '4df1301ec255f4b3727b8ada9811aef8'),
