(2473, 'en', 'default', 'cf58d0bdb1a7290be283d6eecf7ae494', 'Permalinks are the permanent URLs to your individual pages and blog posts, as well as your category and tag archives. A permalink is the web address used to link to your content. The URL to each post should be permanent, and never change &#8212; hence the name permalink.', NULL, NULL, 'LINE', NULL, 0, '', '5e17346941e1c3c5429df2cd864628f8'),
(2474, 'en', 'default', '30f9f179137df7ca8ffbfb5f2f1e3c07', 'This screen allows you to choose your permalink structure. You can choose from common settings or create custom URL structures.', NULL, NULL, 'LINE', NULL, 0, '', 'a24d06ba20bbc9ad1b7f8b3d334e7d15'),
(2475, 'en', 'default', '84760e95a02e1b21fd067dcf8d357fdc', 'You must click the Save Changes button at the bottom of the screen for new settings to take effect.', NULL, NULL, 'LINE', NULL, 0, '', '40de51e1c0d646fdf0d7d9f4efaa3ea7'),
(2476, 'en', 'default', '80eb21ed1fac7886258fd1da7c3268bc', 'Permalinks can contain useful information, such as the post date, title, or other elements. You can choose from any of the suggested permalink formats, or you can craft your own if you select Custom Structure.', NULL, NULL, 'LINE', NULL, 0, '', '341dbad1916c2decd6aead18f094b18b'),
(2477, 'en', 'default', '1a89b9744e617ef3fb4ab7c4fffee90c', 'If you pick an option other than Plain, your general URL path with structure tags (terms surrounded by <code>%</code>) will also appear in the custom structure field and your path can be further modified there.', NULL, NULL, 'LINE', NULL, 0, '', '8a085eced0d0591c402c82cff68cbc18'),
(2478, 'en', 'default', 'cd8d1a19831be7da0547b6a5fcf33156', 'When you assign multiple categories or tags to a post, only one can show up in the permalink: the lowest numbered category. This applies if your custom structure includes <code>%category%</code> or <code>%tag%</code>.', NULL, NULL, 'LINE', NULL, 0, '', '898670c2e52a88ad0454c93711770605'),
(2479, 'en', 'default', '313a4258db970729195e2e53fe33412e', 'Custom Structures', NULL, NULL, 'LINE', NULL, 0, '', '6df19e5a9afce680bb53549314ac67cd'),
(2480, 'en', 'default', 'e3a6c830a45973f8caac3432d436e903', 'The Optional fields let you customize the &#8220;category&#8221; and &#8220;tag&#8221; base names that will appear in archive URLs. For example, the page listing all posts in the &#8220;Uncategorized&#8221; category could be <code>/topics/uncategorized</code> instead of <code>/category/uncategorized</code>.', NULL, NULL, 'LINE', NULL, 0, '', 'c686ed3a11e088be1973308ebe9e40cb'),
(2481, 'en', 'default', 'a451bd8bf8bba202e1d9ea3711855f7e', '<a href="https://codex.wordpress.org/Settings_Permalinks_Screen">Documentation on Permalinks Settings</a>', NULL, NULL, 'LINE', NULL, 0, '', '7c7865bf718adb0ed9a3abd86a6efd47'),
(2482, 'en', 'default', '32422622cd895670750d6f8e3e878c4c', '<a href="https://codex.wordpress.org/Using_Permalinks">Documentation on Using Permalinks</a>', NULL, NULL, 'LINE', NULL, 0, '', '72ee400c9062c148c288dab26d78ae6d'),
(2483, 'en', 'default', 'f2187a07f70a08b8d7c5fdca5f133a0e', 'WordPress offers you the ability to create a custom URL structure for your permalinks and archives. Custom URL structures can improve the aesthetics, usability, and forward-compatibility of your links. A <a href="https://codex.wordpress.org/Using_Permalinks">number of tags are available</a>, and here are some examples to get you started.', NULL, NULL, 'LINE', NULL, 0, '', 'ef56828a2feacb6d1071e6f9c4e5adf5'),
(2484, 'en', 'default', '1a557283e5542468721ccbc770c8b13f', 'archives', NULL, NULL, 'LINE', NULL, 0, 'sample permalink base', '893deb279edb537cdde635951eeeea6e'),
(2485, 'en', 'default', 'f5a8885f26ea1fe06b78b423fa4e9f95', 'Common Settings', NULL, NULL, 'LINE', NULL, 0, '', 'a4fecfee7c1abe31ca7f98d3cf77268a'),
(2486, 'en', 'default', '4cd8413207629a963225f4314b53adcd', 'Plain', NULL, NULL, 'LINE', NULL, 0, '', '37fd33dffddfc3afe6d231de51bcb78a'),
(2487, 'en', 'default', '219806b056351cd209d792c344d523d0', 'Day and name', NULL, NULL, 'LINE', NULL, 0, '', '900ac5841f7e4abc151cc9cc5f43ae62'),
(2488, 'en', 'default', '300b69ef7f0b95e11f87252abd665196', 'sample-post', NULL, NULL, 'LINE', NULL, 0, 'sample permalink structure', '4818dfa52d9ed5863206e82f0ba2776b'),
(2489, 'en', 'default', 'e6e07959e7b527f530ecb8d8d523c1c2', 'Month and name', NULL, NULL, 'LINE', NULL, 0, '', 'c1031883df63df02381881ba4d5a878b'),
(2490, 'en', 'default', '87322391cc6e8948ce9fd5d6cb84fced', 'Numeric', NULL, NULL, 'LINE', NULL, 0, '', '206d80b957d1098a27395906095e6119'),
(2491, 'en', 'default', '55d55eb14be5f3f85d1718475efd3e96', 'Post name', NULL, NULL, 'LINE', NULL, 0, '', '4d9e4410d92ed96a6d97c3ddf3a2f5d0'),
(2492, 'en', 'default', '8860791c508f1a9cd582441eb31955b7', 'Custom Structure', NULL, NULL, 'LINE', NULL, 0, '', '445f5434033c7a4db61a18d146b4d318'),
(2493, 'en', 'default', 'ebb061953c0454b2c8ee7b0ac615ebcd', 'Optional', NULL, NULL, 'LINE', NULL, 0, '', '529fec214c83ccc13ea9f2b9982da799'),
(2494, 'en', 'default', '864e67dda7ff0dc96db5c841bdbf98ad', 'If you like, you may enter custom structures for your category and tag URLs here. For example, using <code>topics</code> as your category base would make your category links like <code>%s/topics/uncategorized/</code>. If you leave these blank the defaults will be used.', NULL, NULL, 'LINE', NULL, 0, '', 'd635a782b4c7393661373e724751b36c'),
(2495, 'en', 'default', 'ab310d2f37f30b946087961899109144', 'Category base', NULL, NULL, 'LINE', NULL, 0, '', 'edc9bf95788a88b2895fdfeb3e78deb7'),
(2496, 'en', 'default', 'ef9da25a81b978fa89fd24bebb04489f', 'Tag base', NULL, NULL, 'LINE', NULL, 0, '', 'b41c076fb39ca023138f6cfaf96dc898'),
(2497, 'en', 'default', 'f5d6040ed78ca86ddc73296a49b18510', 'Save Changes', NULL, NULL, 'LINE', NULL, 0, '', '312c6fe92f15db30d1df6e4e60261924'),
(2504, 'en', 'default', 'a28b02e5b2627766e1d9ebc98edb8e46', 'Permalink structure updated.', NULL, NULL, 'LINE', NULL, 0, '', 'e9c9e182f4f55b8b4c0fbd524c8e2ffc'),
(2505, 'en', 'default', '05919284773edd49431bb2c25283c500', 'Reading Settings', NULL, NULL, 'LINE', NULL, 0, '', '6399142979b01a4eb76d14dfeb80c498'),
(2506, 'en', 'default', '33da0d47041802e3fd26e5365065010a', 'This screen contains the settings that affect the display of your content.', NULL, NULL, 'LINE', NULL, 0, '', '0d6aff48207c056f0e11a40873fd9a8b'),
(2507, 'en', 'default', '64569debf6bd3abbd212384c1a3d0a46', 'You can choose what&#8217;s displayed on the front page of your site. It can be posts in reverse chronological order (classic blog), or a fixed/static page. To set a static home page, you first need to create two <a href="%s">Pages</a>. One will become the front page, and the other will be where your posts are displayed.', NULL, NULL, 'LINE', NULL, 0, '', '467557c5c3be0b00bf0e489063fc1179'),
(2508, 'en', 'default', 'b036d24917cf1c11f1fd7d74084a73d6', 'You can also control the display of your content in RSS feeds, including the maximum numbers of posts to display and whether to show full text or a summary.', NULL, NULL, 'LINE', NULL, 0, '', 'fcbd02de42606f38b5b0a201170633bb'),
(2509, 'en', 'default', 'f5752ab5c7a0fb0f40be53417ace7247', 'Search Engine Visibility', NULL, NULL, 'LINE', NULL, 0, '', '7cb2843c487aedb2909244818df8fdf8'),
(2510, 'en', 'default', '0754b49868a7a0ac641085882e136d75', 'You can choose whether or not your site will be crawled by robots, ping services, and spiders. If you want those services to ignore your site, click the checkbox next to &#8220;Discourage search engines from indexing this site&#8221; and click the Save Changes button at the bottom of the screen. Note that your privacy is not complete; your site is still visible on the web.', NULL, NULL, 'LINE', NULL, 0, '', '1051f547d613d166e58ee2267ea6046e'),
(2511, 'en', 'default', '4210a86ca0a86ebdf5712c60c47a01ca', 'When this setting is in effect, a reminder is shown in the At a Glance box of the Dashboard that says, &#8220;Search Engines Discouraged,&#8221; to remind you that your site is not being crawled.', NULL, NULL, 'LINE', NULL, 0, '', '33960768ca0efb2109671f1ab02318f6'),
(2512, 'en', 'default', '683f4106f8e5ad2034b19900421a4f8e', '<a href="https://codex.wordpress.org/Settings_Reading_Screen">Documentation on Reading Settings</a>', NULL, NULL, 'LINE', NULL, 0, '', '8bcd56596f7cc9e41ad8785e74eac871'),
(2513, 'en', 'default', '4b115c055f3bc24a7aca3bd2df5c741b', 'Front page displays', NULL, NULL, 'LINE', NULL, 0, '', '83285eafda17b9cdb79efc58f8db6149'),
(2514, 'en', 'default', '454dab8b4e0a51ba2efeb06242391785', 'Your latest posts', NULL, NULL, 'LINE', NULL, 0, '', '40a870726d4880aa6b93ea3d975a2f19'),
