(3564, 'en', 'default', '4d26943fa96797a4136ef47c5084b772', 'You can use categories to define sections of your site and group related posts. The default category is &#8220;Uncategorized&#8221; until you change it in your <a href="%s">writing settings</a>.', NULL, NULL, 'LINE', NULL, 0, '', '58e0f4bd0db3f201181a24e22518af6b'),
(3565, 'en', 'default', 'a898fa08a0cadfff38577d1a8d36312d', 'What&#8217;s the difference between categories and tags? Normally, tags are ad-hoc keywords that identify important information in your post (names, subjects, etc) that may or may not recur in other posts, while categories are pre-determined sections. If you think of your site like a book, the categories are like the Table of Contents and the tags are like the terms in the index.', NULL, NULL, 'LINE', NULL, 0, '', '4d97505e61693c0a1aac1b958fe094ac'),
(3566, 'en', 'default', '16eb38b0466b758e83ffc1afb65bc986', 'When adding a new category on this screen, you&#8217;ll fill in the following fields:', NULL, NULL, 'LINE', NULL, 0, '', '8348240c846a4cb879a67a7a1e6818ca'),
(3567, 'en', 'default', '1c8ad85a1a29170a2c98285371e4ac2d', '<strong>Name</strong> &mdash; The name is how it appears on your site.', NULL, NULL, 'LINE', NULL, 0, '', '5febbe59b4e8c2b38e143b3cff8ae190'),
(3568, 'en', 'default', '411d40a6a21e11c47ed8adb1c92f00b0', '<strong>Slug</strong> &mdash; The &#8220;slug&#8221; is the URL-friendly version of the name. It is usually all lowercase and contains only letters, numbers, and hyphens.', NULL, NULL, 'LINE', NULL, 0, '', '97af8d8b956434fb602f37b6e0e53e27'),
(3569, 'en', 'default', '4ea8e185f297fa1e5706a8337719effe', '<strong>Parent</strong> &mdash; Categories, unlike tags, can have a hierarchy. You might have a Jazz category, and under that have child categories for Bebop and Big Band. Totally optional. To create a subcategory, just choose another category from the Parent dropdown.', NULL, NULL, 'LINE', NULL, 0, '', 'eec619c60b3b0a3e38f0069c120d2602'),
(3570, 'en', 'default', '455ea6f84b4f4e0349d551dbb50d3a42', '<strong>Description</strong> &mdash; The description is not prominent by default; however, some themes may display it.', NULL, NULL, 'LINE', NULL, 0, '', 'bf0e83818cfea660dd6082860a6da784'),
(3571, 'en', 'default', 'ceb79a4cdaccc9c24ea22489ba03429f', 'You can change the display of this screen using the Screen Options tab to set how many items are displayed per screen and to display/hide columns in the table.', NULL, NULL, 'LINE', NULL, 0, '', '59cf444b48715208ad794a188fdb27a3'),
