(5097, 'en', 'wpml-string-translation', '2f0288cf885faa6831539259b6a9a949', 'Click to toggle', NULL, NULL, 'LINE', NULL, 0, '', '19d0ab5b26917dfcb427583eb68f6a44'),
(5098, 'en', 'wpml-string-translation', '64f6bee3dbe7df1e6bcdd30c0b63970a', 'Track where strings appear on the site', NULL, NULL, 'LINE', NULL, 0, '', '78a19a10011883c4d8f91ecd829f0a94'),
(5099, 'en', 'wpml-string-translation', '0256958abd6d6a8a78b2f985e36dc80a', 'WPML can keep track of where strings are used on the public pages. Activating this feature will enable the ''view in page'' functionality and make translation easier.', NULL, NULL, 'LINE', NULL, 0, '', '1d90ece3c46ea94bb83c61d17593f2f5'),
