(5101, 'en', 'wpml-string-translation', '931a1cc8b98929436703f71dfd488a28', '%s allows you to see where strings come from, so you can translate them accurately.', NULL, NULL, 'LINE', NULL, 0, 'String Tracking warning: sentence 1', '6ac7caef840c8639caa34c986ec7466c'),
(5102, 'en', 'wpml-string-translation', 'f55105e80a3ac773251cb6231fea5096', 'It needs to parse the PHP source files and the output HTML.', NULL, NULL, 'LINE', NULL, 0, 'String Tracking warning: sentence 2', '38bd118a14bd27e3c9cad753fafaa012'),
(5103, 'en', 'wpml-string-translation', 'bba3bfb6b6992b3bad9735af3bc5bea3', 'This feature is CPU-intensive and should only be used while you are developing sites.', NULL, NULL, 'LINE', NULL, 0, 'String Tracking warning: sentence 3', '2e19a903dc990117fc4d1743e705e7d4'),
(5104, 'en', 'wpml-string-translation', '665ade473a97bea36c3013ce3e77fab7', 'Remember to turn it off before going to production, to avoid performance problems.', NULL, NULL, 'LINE', NULL, 0, 'String Tracking warning: sentence 4', '809b8c9635da38b5e54d26a177ab1408'),
