(5742, 'en', 'default', 'bc49a7bd37360447641feb4fc7e23c3b', 'Your profile contains information about you (your &#8220;account&#8221;) as well as some personal options related to using WordPress.', NULL, NULL, 'LINE', NULL, 0, '', 'c37c18aa47a453841fda46b1d4f948ae'),
(5743, 'en', 'default', 'aa6b50ebfd26013f727b5bddd1a0020a', 'You can change your password, turn on keyboard shortcuts, change the color scheme of your WordPress administration screens, and turn off the WYSIWYG (Visual) editor, among other things. You can hide the Toolbar (formerly called the Admin Bar) from the front end of your site, however it cannot be disabled on the admin screens.', NULL, NULL, 'LINE', NULL, 0, '', 'b9b4d0532a778cafb41ef6adf422c685'),
(5744, 'en', 'default', 'ecf5914ee8ec7cfa4e0744d83a3cfb09', 'You can select the language you wish to use while using the WordPress administration screen without affecting the language site visitors see.', NULL, NULL, 'LINE', NULL, 0, '', 'fd5735268d8e29b5fb70169e194cfcba'),
