(5746, 'en', 'default', 'b9ee24b2ed698a7774a132f859a7440b', 'You can log out of other devices, such as your phone or a public computer, by clicking the Log Out Everywhere Else button.', NULL, NULL, 'LINE', NULL, 0, '', '1b241a88804ad03a64423db084510037'),
(5747, 'en', 'default', '0691d23eff65b6b03d4b3d9db7c216e3', 'Required fields are indicated; the rest are optional. Profile information will only be displayed if your theme is set up to do so.', NULL, NULL, 'LINE', NULL, 0, '', '61ba8be97a75bdc87be4fddf67cf74c6'),
